import styled from "styled-components";

export const StyledContainer = styled.div`
    margin-top: 10vh;
    scroll-snap-type: y mandatory;
    display: flex;
    flex-direction: column;
    position: absolute;
    overflow-y: scroll;
    max-height: 100vh;
`;
